// GoogleMapsPage.js
import React, { useEffect } from 'react';
import './App.css';

const GoogleMapsPage = () => {
  useEffect(() => {
    const script = document.createElement('script');
    //AIzaSyCxeUdvj51wZw2uNqlPBK5FKt5ILsG5DCk
    //AIzaSyBCf5wuH1-3yr4NixUu8Ssi4HseiwHnpiM

    script.src = 'https://maps.googleapis.com/maps/api/js?key=AIzaSyAzM7lShQm_zPKuRJWk5gG6RnCU48Hmz3A&callback=console.debug&libraries=maps,marker&v=beta&callback=initMap';
    script.defer = true;
    script.async = true;

    script.onload = () => {
      initMap();
    };

    script.onerror = () => {
      console.error('Error loading Google Maps API script.');
    };

    document.head.appendChild(script);

    return () => {
      document.head.removeChild(script);
    };
  }, []);

  const initMap = () => {
    // 'map' is assigned a value and used in the next line
    const map = new window.google.maps.Map(document.getElementById('map'), {
      center: { lat: 37.227653, lng: -80.421832 }, // Virginia Tech Campus
      zoom: 12,
    });

    // Your map-related functionality here, for example:
    const marker = new window.google.maps.Marker({
      position: { lat: 37.227653, lng: -80.421832 }, // Virginia Tech Campus
      map: map,
      title: 'Virginia Tech'
    });

    // Example: Add an event listener for the marker
    marker.addListener('click', () => {
      console.log('Marker clicked!');
    });
  };

  return (
    <div id="title style=">
      <h2>Google Maps Page</h2>
      <div id="map" style={{ textAlign: 'center', width: '800px', height: '800px', margin: '0 auto', marginBottom: '20px',  }}></div>
    </div>
  );
};

export default GoogleMapsPage;
